import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link, useParams, useNavigate } from "react-router-dom";
import "../App.css";
import BuyModal from "../Modals/BuyModal";
import SellModal from "../Modals/SellModal";

const GameDetails = (props) => {
    let {repoName} = useParams();
    const [commitData, setCommitData] = useState(undefined);
    const [page, setPage] = useState(parseInt(pagenum));
    const [disable, setDisable] = useState(false);
    const [error, setError] = useState(false);
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

  useEffect(() => {
    setPage(parseInt(pagenum));
    setError(false);
    async function fetchData() {
      try {
        const { data } = await axios.get(`https://api.github.com/repos/netflix/${repoName}}/commits?page=${page}`);
        setCopies(data);
      } catch (e) {
        setError(true);
        console.log(e);
      }
    }
    fetchData();
  }, [id, copies]);


  if (loading) {
    return (
      <div>
        <h2>Loading....</h2>
      </div>
    );
  } else if (error) {
    return (
      <div>
        <h2>404: NO DATA</h2>
      </div>
    );
  }

  let img;
  {
    gameData.background_image
      ? (img = gameData.background_image)
      : (img = "null");
  }
  return (
    <div>
      <div className="card mb-3">
        <div className="card-body">
          <img src={img} className="card-img-top img-thumbnail" alt="..." />
          <div className="card-body">
            <h5 className="card-title">
              {gameData.name ? gameData.name : "No name Available"}
            </h5>
            <p className="card-text" style={copies === 0? {color: 'red'} : {color: 'green'}}>Copies Available: {copies}</p>
            <ul className="list-group list-group-flush">
              <li className="list-group-item">
                {gameData.rating === 0
                  ? "Rating: N/A"
                  : `Rating: ${gameData.rating}`}
              </li>
              <li className="list-group-item">
                {gameData.description_raw
                  ? gameData.description_raw
                  : `No description available`}
              </li>
              <li className="list-group-item">
                ESRB Rating:{" "}
                {gameData.esrb_rating ? gameData.esrb_rating.name : "No Rating"}
              </li>
              <li className="list-group-item">
                {gameData.genres.map((genre) => {
                  return (
                    <p styles="display:inline;" key={genre.name}>
                      {genre.name}
                    </p>
                  );
                })}
              </li>
              <li className="list-group-item">
                {gameData.metacritic_url ? (
                  <Link to={gameData.metacritic_url}> Metacritic Website </Link>
                ) : (
                  "No Metacritic Link"
                )}
              </li>
              <li className="list-group-item">
                {gameData.website ? (
                  <Link to={gameData.website}> Game Website </Link>
                ) : (
                  "No Website Link"
                )}
              </li>
            </ul>
          </div>
          <button
            type="button"
            className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 focus:outline-none"
            data-bs-toggle="modal"
            data-bs-target="#buyModal"
            disabled={copies === 0}
          >
            Buy Game
          </button>
          <button
            type="button"
            className="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 focus:outline-none"
            data-bs-toggle="modal"
            data-bs-target="#sellModal"
          >
            Sell Game
          </button>
          {showSellModal ? (
            <SellModal gameId={gameData.id} gameName={gameData.name} />
          ) : null}
          {showBuyModal ? (
            <BuyModal gameId={gameData.id} gameName={gameData.name} />
          ) : null}
        </div>
      </div>
    </div>
  );
};
export default GameDetails;
